import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import UrheilijatProvider from './contexts/UrheilijatContext';
import UrheilijatList from './components/UrheilijatList';
import UrheilijaDetails from './components/UrheilijaDetails';

function App() {
  return (
    <Router>
      <UrheilijatProvider>
        <Switch>
          <Route exact path="/" component={UrheilijatList} />
          <Route path="/urheilija/:id" component={UrheilijaDetails} />
        </Switch>
      </UrheilijatProvider>
    </Router>
  );
}

export default App;
